$(function () {
  $('.header-nav-dropdown-btn').on('click', function () {
    var $headerNavs = $('.header-nav').add('.subheader-container');

    if ($headerNavs.is(":visible")) {
      $headerNavs.removeClass("active");
    } else {
      $headerNavs.addClass("active");
      var $announcementBar = $('.announcement-container');

      if ($announcementBar) {
        $announcementBar.addClass("hidden");
      }
    }
  });

  $(window).on('resize', function () {
    if (window.matchMedia("only screen and (max-width: 640px)").matches) {
      $('.header-nav').add('.subheader-container').removeClass('active');
    } else {
      $('.header-nav').add('.subheader-container').addClass('active');
    }
  });
});
