$(function () {
  var removeModal = function (e) {
    // AMC: Do not close modal on click of inputs in Talent Match contact form
    if(e && $(e.target).parents('.tm-contact-form').length === 1) {
      return;
    }

    $('body').css({"overflow": "initial"});
    $('.modal-background').hide();
    $(document).off('keydown');
    $('.modal-background').off('click');

    $('iframe.software-engineer-video').attr(
      'src',
      "https://www.youtube.com/embed/watch?v=0TI0H1zNcLA"
    );
  }

  var showModal = function (e) {
    e.preventDefault();

    $('body').css({"overflow": "hidden"});

    $('.modal-background').show();

    $('iframe.software-engineer-video').show();

    $('iframe.software-engineer-video').attr(
      'src',
      "https://www.youtube.com/embed/0TI0H1zNcLA?rel=0&autoplay=1"
    );

    $('.apply-program-selector').add('.program-selector-item').removeClass("active");

    $(document).on('keydown', function (e) {
      if (e.keyCode === 27) {
        removeModal();
      }
    });

    $('.modal-content').on('click', function(e) {
      e.stopPropagation();
    });

    $('.modal-background').on('click', removeModal);

    $('.modal-content i.fa-times-circle').on('click', removeModal);
  };

  $('.trigger-modal').on('click', function (e) {
    showModal(e);

    if ($(e.currentTarget).parent().hasClass('header-apply-container')) {
      var $video = $('iframe.software-engineer-video');
      $video.attr('src', "");
      $video.hide();
      $('.apply-program-selector').addClass("active");
    }
  });

  $('.program-selector-item').on('click', function (e) {
    e.stopPropagation();
    $('.program-selector-item').removeClass("active");
    var $selector = $(e.currentTarget);
    $selector.addClass("active");
    $('footer.program-selector a').attr('href', $selector.data('program-url'));
  });
});
$(function() {
  $('.day-carousel-toggle').each(function () {
    $(this).on('click', function (e) {
      var $carousel = $('.day-carousel');
      var numImages = $carousel.find('img').length;

      var n = parseInt($carousel.attr('class').match(/\d/)[0]);
      $carousel.removeClass("active-" + n.toString());


      if ($(e.currentTarget).hasClass('toggle-right')) {
        n %= numImages;
        $carousel.addClass("active-" + (n + 1).toString());
      } else {
        if (n === 1) {
          n = numImages + 1;
        }

        $carousel.addClass("active-" + (n - 1).toString());
      }
    });
  });
});
$(function() {
  $('a[href*="#"]:not([href="#"])').click(function() {
    if (location.pathname.replace(/^\//,'') == this.pathname.replace(/^\//,'') && location.hostname == this.hostname) {
      var target = $(this.hash);
      target = target.length ? target : $('[name=' + this.hash.slice(1) +']');
      if (target.length) {
        $('html, body').animate({
          scrollTop: target.offset().top
        }, 500);
        return false;
      }
    }
  });
});
$(function () {
  function TabToggle ($el, $btns, $panels) {
    this.$el = $el;
    this.$target = $panels.closest("." + this.$el.data('target'));
    this.$btns = $btns;
    this.$panels = $panels;

    this.$el.on('click', this.handleClick.bind(this));
  };

  TabToggle.prototype = {
    handleClick: function (e) {
      if (window.innerWidth <= 800) {
        this.mobileTabToggle(e);
      } else {
        this.activateTarget(e);
      }
    },

    mobileTabToggle: function(e) {
      if (this.$el.hasClass("landing-tab") && this.$el.hasClass("active")) {
        e.preventDefault();

        var $inactiveTabs = this.$btns.not('.active');

        if ($inactiveTabs.hasClass("stack-1")) {
          this.$btns.removeClass(function (index, css) {
            return (css.match (/(^|\s)stack-\S+/g) || []).join(' ');
          });
        } else {
          $inactiveTabs.each(function (idx) {
            $(this).addClass("stack-" + (idx + 1).toString());
          });
        }
        return;
      } else if (this.$el.hasClass("advantage-panel")) {
        return;
      }

      this.$btns.removeClass(function (index, css) {
        return (css.match (/(^|\s)stack-\S+/g) || []).join(' ');
      });

      this.activateTarget(e);
    },

    activateTarget: function (e) {
      if (this.$el.hasClass('landing-tab')) {
        e.preventDefault();
        window.history.pushState({}, "", this.$el.attr('href'));
      }

      this.$panels.removeClass('active');
      this.$btns.removeClass('active');

      this.$el.addClass('active');

      this.$target.addClass('active');
    }
  }

  $('.tab-toggle').each(function () {
    var $that = $(this);
    var $btns = $("." + $that.data('btn-class'));
    var $panels = $("." + $that.data('panel-class'));

    $(this).children("." + $that.data('btn-class')).map(function () {
      new TabToggle($(this), $btns, $panels);
    });
  });
});
document.addEventListener("DOMContentLoaded", function () {
  var $testimonials = document.getElementsByClassName("testimonials-article"),
    $links = document.getElementsByClassName("testimonials-link");

  function show(testimonial) {
    for (var i=0; i<$testimonials.length; i++) {
      $testimonials[i].style.display = (i === testimonial ? "block" : "none");
      $links[i].className = "testimonials-link" + (i === testimonial ? " active" : "");
    }
  };

  show(0);

  for (var j=0; j<$links.length; j++) {
    $links[j].onclick = (function() {
      var J = j;
      return function() {
        show(J);
      }
    })();
  }
});
(function () {
  function Timer($container) {
    this.$container = $container;
    this.$timer = this.$container.find('.timer');

    this.objName = $container.data("objName")
    this.initTime(Timer.parseDateUTC($container.data("startStr")));
    this.overTime = false;

    Timer.registerWarningHandlers();
    setInterval(this.tick.bind(this), 1000);
  }

  Timer.parseDateUTC = function(str) {
    str = str.replace(" UTC", "")
    var reg = /^(\d{4})-(\d{2})-(\d{2}) (\d{2}):(\d{2}):(\d{2})$/;
    var parts = reg.exec(str);

    if (parts) {
      return new Date(Date.UTC(
        parts[1], parts[2] -1, parts[3], parts[4], parts[5],parts[6]
      ));
    } else {
      return new Date();
    }
  }

  Timer.registerWarningHandlers = function () {
    $(window).on("beforeunload", function () {
      return "CAUTION: Did you mean to exit? The timer for your test will continue to run and you will lose what you've written."
    });

    $('input[type="submit"]').on('click', function (e) {
      $(window).off("beforeunload");
    });
  }

  Timer.prototype = {
    initTime: function (startDate) {
      diff = (new Date() - startDate) / 1000;

      this.seconds = parseInt(diff % 60);
      diff /= 60;

      this.minutes = parseInt(diff % 60);
      diff /= 60;

      this.hours = parseInt(diff % 24);
    },

    _incrementSeconds: function () {
      this.seconds += 1;
      if (this.seconds === 60) {
        this.seconds = 0;
        this._incrementMinutes();
      }
    },

    _incrementMinutes: function () {
      this.minutes += 1;
      if (this.minutes === 60) {
        this.minutes = 0;
        this._incrementHours();
      }
    },

    _incrementHours: function () {
      this.hours = this.hours + 1;
    },

    toString: function () {
      return [this.hours, this.minutes, this.seconds].map(function (el) {
        return el < 10 ? "0" + el.toString() : el.toString();
      }).join(":");
    },

    checkOverTime: function () {
      if (this.objName === "second_coding_test") {
        this.overTime = this.hours > 0;
      } else {
        this.overTime = this.minutes >= 45 || this.hours > 0;
      }

      if (this.overTime) {
        this.$container.addClass('over-time');
      }
    },

    tick: function () {
      this._incrementSeconds();
      this.$timer.html(this.toString());
      this.checkOverTime();
    }
  }

  $(window).on("DOMContentLoaded", function () {
    $('.timer-container').each(function () {
      new Timer($(this));
    });
  });
})();
$(function () {
  $('.aa-survey-form').on('submit', function (e) {
    e.preventDefault();

    $('.modal-background').show();
    $('.aa-survey-errors').empty();

    $('.aa-select-container select').prop("disabled",
      $('.aa-select-container').css("display") === "none"
    );

    $('.aa-radio-container input').prop("disabled",
      $('.aa-radio-container').css("display") === "none"
    );

    $.ajax({
      url: '/api/surveys',
      method: 'POST',
      data: $(e.currentTarget).serialize(),
      success: function (survey) {
        window.location.replace('/surveys/thank_you');
      },
      error: function (xhr) {
        $('.modal-background').hide();

        if (xhr.status === 422) {
          var errors = xhr.responseJSON.errors;
          var $li;

          errors.forEach(function (error) {
            $li = $("<li></li>");
            $li.html(error);
            $('.aa-survey-errors').append($li);
          });
        }
        window.scrollTo(0, 0);
      }
    });
  });
});
